INSERT INTO `configuracao` (`idConfiguracao`, `chaveConfiguracao`, `idCategoria`, `idSubCategoria`, `nome`, `tipoValor`, `valor`, `valorPadrao`, `explicacao`, `editavel`, `visivel`, `idSituacaoCadastro`, `dataCriacao`, `dataAlteracao`, `criadoPor`, `modificadorPor`) VALUES
	(1, 'config_1', 1, 1, 'Considerar crachá para coletor', 'boolean', 'false', 'false', 'Ao ativar esta configuração, todas as integrações com o equipamento "Facial Visio (Coletor)" passarão a utilizar o crachá como identificador do colaborador.', 1, 1, 1, '2025-11-10 15:03:41', '2025-11-10 15:03:41', 'sistema', 'sistema'),
	(2, 'config_2', 2, 1, 'Criptografar CPF dos colaboradores', 'boolean', 'false', 'false', 'Ao ativar esta configuração, todos os gestores (perfis que não são do tipo Administrador) visualizarão os CPFs dos colaboradores de forma criptografada.', 0, 0, 1, '2025-11-10 15:03:41', '2025-11-10 15:03:41', 'sistema', 'sistema'),
	(3, 'config_3', 3, 1, 'Limite para abono/solicitações', 'boolean', 'false', 'false', 'Ao ativar esta configuração, todos os ajustes manuais aceitos pelos gestores (perfis que não são do tipo Administrador) passarão por uma verificação de limite, sendo recusados caso o colaborador já tenha dois ajustes realizados no mês.', 0, 0, 1, '2025-11-10 15:03:41', '2025-11-10 15:03:41', 'sistema', 'sistema'),
	(4, 'config_4', 3, 1, 'Recálculo automático de marcação de ponto', 'boolean', 'false', 'false', 'Ao ativar essa configuração, sempre que uma marcação par (a segunda, quarta, sexta marcação e em diante...) subir para o espelho ponto, aquele dia específico será recalculado automaticamente.', 0, 0, 1, '2025-11-10 15:03:41', '2025-11-10 15:03:41', 'sistema', 'sistema'),
	(5, 'config_5', 4, 1, 'Assinatura Gestor', 'boolean', 'false', 'false', 'Ao ativar essa configuração, serão habilitadas as assinaturas do chefe imediato e do chefe mediato, que aparecerão no relatório caso estejam cadastradas.', 0, 0, 1, '2025-11-10 15:03:41', '2025-11-10 15:03:41', 'sistema', 'sistema');
