-- Copiando estrutura para função dixipontoapi_dev.CRC16
DROP FUNCTION IF EXISTS `CRC16`;
DELIMITER //
CREATE FUNCTION `CRC16`(
    _STRING VARCHAR(600)
) RETURNS varchar(50) CHARSET utf8mb4
    DETERMINISTIC
BEGIN
   DECLARE _myCRC integer;
    DECLARE _ord INTEGER;
    DECLARE _n Integer;
    DECLARE _m Integer;
    DECLARE _strlend Integer;
    SET _myCRC := 0xFFFF;

      SET _n  := 1;
      SET _strlend := LENGTH(_STRING) ;

        loop_crc:  LOOP

            IF  _n > _strlend THEN 
                LEAVE  loop_crc;
            END  IF;

            SET _ord := ORD(SUBSTRING(_STRING, _n, 1) );
            SET _myCRC :=  _myCRC ^ _ord;
            SET _m := 0;
            loop_bit:  LOOP
                IF  _m = 8 THEN 
                    LEAVE  loop_bit;
                END  IF;
                IF (_myCRC & 0x0001) = 0x0001 THEN
                    SET _myCRC := (_myCRC >> 1) ^ 0xA001;
                ELSE
                    SET _myCRC := _myCRC >> 1;
                END IF;
                SET  _m := _m + 1;
            END LOOP;
            SET  _n := _n + 1;

        END LOOP;

      return HEX(_myCRC); 
 END//
DELIMITER ;

